/**
 * Retrieve the object indexed by a key.
 * 
 *@param key
 *          A <code>String</code> index.
 *@return The object retrieved from the Ternary Search Trie.
 */
public Object get(CharSequence key) {
  TSTNode node = getNode(key);
  if (node == null) {
    return null;
  }
  return node.data;
}

